import React from 'react'

export default function TextForm(props) {
  return (
    <div>
        <h1 my-3>{props.heading}</h1>
        <div class="mb-3">
            <label for="mybox" class="form-label">Example label</label>
            <input type="text" class="form-control" id="mybox" placeholder="Example input placeholder"/>
        </div>
    </div>
  )
}
